                            {d.trabajadores?.length || 0}
                        </DiaBarraaHolder>
                    )}                    
                </Row>
            </div>
            <div className="h-50">
            <Row className="text-white p-0 m-0 h-100 w-100">
                    <DiaBarraaHolder>N</DiaBarraaHolder>
                    {semanaAnterior.dias.map((d)=>
                        <DiaBarraaHolder>
                            {d.trabajadores?.length || 0}
                        </DiaBarraaHolder>
                    )}                    
                </Row>

            </div>
        </div>
    )
}
